I think adding the shading at the end is probably my favorite part of the process. To me, this is when the magic happens.

This is the last of the process where things get pulled forward and pushed back giving it the depth to create the separation between the different elements of the tattoo.

It’s crazy how adding a simple drop shadow here and a drop shadow there can change the entire look and feel of the tattoo.

I love doing this style so much!

