🚩COVERUP🚩 Sometimes things need to be covered up. This was a difficult one for a lot of reasons. I was covering up my own work. My vision and my client’s weren’t the same.  It happens sometimes. I was pleased with the original tattoo. My client was not. 

I was tasked with covering a tattoo that was put in to stay in. The tattoo was also under a year old. I knew I could covert it up but it was the size restriction that was the most difficult challenge to deal with. 

The coverup is almost exactly the same size as the original tattoo. It will probably need one more pass on the opaque greys to fully cover the old tattoo. 

Easily one of the most challenging situations I’ve had to overcome.

