Consistency and a good healed product has always been very important to me. A tattoo can look amazing when it’s finished but it’s how it heals out and settles into the skin. 
“Shelf life” of the tattoo is very important to me. I believe a tattoo should still look good ten years down the road. No, they won’t be perfect but that should still hold their values over time. 
This is why I approach my tattoos using only black with no grey wash at all. Does it take longer? Hell yes it does, but this process should give the piece longevity and it will also be readable for years to come.

